// src/components/services/SingleAnalysis.js
import React, { useState } from 'react';
import { MOCK_SINGLE_RESULT } from '../../data/mockData';

const SingleAnalysis = () => {
  const [inputText, setInputText] = useState('');
  const [result, setResult] = useState(null);
  const [isAnalyzing, setIsAnalyzing] = useState(false);

  const analyzeText = () => {
    if (!inputText.trim()) {
      alert('Please enter some text to analyze');
      return;
    }

    setIsAnalyzing(true);

    setTimeout(() => {
      const mockResult = {
        ...MOCK_SINGLE_RESULT,
        model_info: {
          ...MOCK_SINGLE_RESULT.model_info,
          timestamp: new Date().toISOString()
        }
      };
      setResult(mockResult);
      setIsAnalyzing(false);
    }, 1500);
  };

  const loadSampleText = () => {
    setInputText('Led security architecture initiatives for enterprise cloud migration, implementing zero-trust frameworks and identity access management systems. Conducted threat assessments and vulnerability analyses, ensuring compliance with ISO27001 and GDPR regulations. Managed incident response procedures and coordinated with SOC teams for continuous security monitoring.');
  };

  const clearAnalysis = () => {
    setInputText('');
    setResult(null);
  };

  return (
    <div className="space-y-6">
      <div className="bg-green-50 border border-green-200 rounded-lg p-4">
        <h4 className="text-green-800 font-semibold mb-2">Single Analysis</h4>
        <p className="text-green-700 text-sm">
          Paste job or resume text to extract relevant cybersecurity skills across 6 specialized domains.
        </p>
      </div>

      <div className="form-group">
        <label className="block text-sm font-medium text-gray-700 mb-2">
          Text to Analyze
        </label>
        <textarea
          className="w-full p-4 border border-gray-300 rounded-lg focus:ring-2 focus:ring-green-500 focus:border-green-500 resize-vertical"
          rows="6"
          value={inputText}
          onChange={(e) => setInputText(e.target.value)}
          placeholder="Paste resume content, job description, or any text to extract cybersecurity skills..."
        />
      </div>

      <div className="flex gap-3 flex-wrap">
        <button 
          className="bg-green-600 text-white px-6 py-3 rounded-lg hover:bg-green-700 disabled:opacity-50 disabled:cursor-not-allowed font-medium transition-colors" 
          onClick={analyzeText} 
          disabled={isAnalyzing || !inputText.trim()}
        >
          {isAnalyzing ? 'Extracting...' : 'Extract Skills'}
        </button>

        <button 
          className="border border-gray-300 text-gray-700 px-6 py-3 rounded-lg hover:bg-gray-50 font-medium transition-colors" 
          onClick={loadSampleText}
        >
          Load Sample
        </button>

        <button 
          className="border border-red-300 text-red-700 px-6 py-3 rounded-lg hover:bg-red-50 font-medium transition-colors" 
          onClick={clearAnalysis}
        >
          Clear
        </button>
      </div>

      {isAnalyzing && (
        <div className="bg-blue-50 border border-blue-200 rounded-lg p-4">
          <div className="flex items-center gap-3">
            <div className="animate-spin rounded-full h-5 w-5 border-b-2 border-blue-600"></div>
            <div>
              <div className="text-blue-800 font-medium">Extracting cybersecurity skills...</div>
              <div className="text-blue-600 text-sm">Analyzing across 6 specialized security domains</div>
            </div>
          </div>
        </div>
      )}

      {result && (
        <div className="bg-white border border-gray-200 rounded-lg p-6 shadow-sm">
          <h4 className="text-lg font-semibold text-gray-900 mb-4">Skill Extraction Results</h4>
          <p className="text-gray-600 text-sm mb-4">
            Analyzed: {new Date(result.model_info.timestamp).toLocaleString()}
          </p>

          {/* Category Section */}
          <div className="bg-gray-50 p-4 rounded-lg mb-4 border">
            <h5 
              className="font-semibold mb-2" 
              style={{ color: result.prediction.category_color }}
            >
              {result.prediction.category_name}
            </h5>
            <p className="text-gray-600 text-sm">{result.prediction.category_description}</p>
          </div>

          {/* Skills Section */}
          <h6 className="font-semibold text-gray-900 mb-3">
            Extracted Skills ({result.skills.skill_count})
          </h6>

          <div className="grid gap-3 md:grid-cols-2">
            {result.skills.extracted_skills.map((skill, index) => (
              <div key={index} className="border border-gray-200 p-3 rounded-lg hover:shadow-sm transition-shadow">
                <h6 className="font-medium text-gray-900 mb-1">{skill.name}</h6>
                <p className="text-gray-600 text-sm mb-0">{skill.description}</p>
              </div>
            ))}
          </div>

          {/* Model Info */}
          <div className="mt-6 pt-4 border-t border-gray-200">
            <div className="grid grid-cols-2 gap-4 text-sm">
              <div>
                <span className="font-medium text-gray-700">Mode:</span>
                <span className="ml-2 text-gray-600">{result.model_info.mode}</span>
              </div>
              <div>
                <span className="font-medium text-gray-700">Extractor:</span>
                <span className="ml-2 text-gray-600">{result.model_info.extractor_mode}</span>
              </div>
            </div>
          </div>
        </div>
      )}
    </div>
  );
};

export default SingleAnalysis;
